Oral disc (
Fig. 2
) umbelliform, terminal, and orientated dorsally, emarginated, thus separating upper and lower labia ‘high’ on oral disc, large, ODW 43% of BL and 70% of BW. Lower labium big, with a median notch on half its length; upper labium as two small lateral extensions, absent on median half. Inner edge lined by tiny papillae, inner side of lower labium bearing more or less rounded ridges reminiscent of papillae, a horizontal row of papillae on bottom in front of mouth opening, a large and round structure on midline just behind median notch, an elongate ‘papilla’ laterally on each side orientated anterolaterally; each part of upper labium bearing a dorsoventrally orientated ridge. No keratodonts. Jaw sheaths soft, not keratinized, very finely serrated (serrations of lower beak elongate); upper jaw sheath wide, flat and shallow, white with grey serrations; lower jaw sheath V-shaped, white with black serrations.
